import React from 'react';

const FaceRecognition = ({ imageUrl }) => { // fonction pure, utilise une fonction fléchée, reçoit props imageUrl (la destructure et la passe en param)
    return (
        <div className='center'>
            <img alt='image' src={imageUrl} />
        </div>
    )
}

export default FaceRecognition;
